        function getMark(){
    var typeSelect = $('#fs_type').val();
    $.ajax({
        type: "GET",
        url: `https://www.mod-files.com/api/chip/v1/types/${typeSelect}/marks?api_key=835307363327&api_secret=0d3623801d9a7f5717169163ee656fda`,
        data: "data",
        dataType: "json",
        success: function (response) {
            console.log("success")
            console.log(response);
            console.log(response.data)
            var options = [];
            options.push("<option value=''> Choose </option>");
            for (let item in response.data) {
                console.log("fro: " + response.data[item].mark.name);
                options.push(`<option value="${response.data[item].mark.id}">${response.data[item].mark.name}</option>`);
            }
            options.sort(function(a, b) {
                return a.localeCompare(b, 'en', {sensitivity: 'base'});
            }); // ترتيب الخيارات بشكل أبجدي
            document.getElementById("fs_mark").innerHTML = options.join("");
